import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { Link, Outlet } from 'react-router-dom'

const HomeJ = () => {
  const[myrecipe,setmyrecipe]=useState([])
  useEffect(function(){
    axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
  },[])
  return  <div className='row text-center'>
      {myrecipe?.map(n=><div  ><div className='col-sm-3'><div className='thumbnail' style={{width}}><p  key={n.id}><Link to={`mymoredetails/${n._id}`}><div >   
      <img src={n.pic} width="230" height="190"></img><p><strong>{n.name}</strong></p>
      <p>Fri. 27 November 2015</p>
      <button class="btn">More details</button></div></Link><br></br></p></div></div></div>)}
      <Outlet ></Outlet>
      </div>
}

export default HomeJ
